import { container } from "assets/jss/material-kit-react.jsx";

const CountStyle = {
	root: {
		background: "#333", 
		color: "#fff", 
		textAlign: "center", 
		padding: "70px 0"
	},
	container: {
		color: "#ffffff",
		display: "flex",
		flexWrap: "wrap",
		...container
	},
	column: {
		width: "25%",
		'&::after': {
			fontFamily: `"Poppins", sans-serif`,
			fontSize: "65px",
		},
	}
};

export default CountStyle;
